import { useGameLogic } from './useGameLogic';
import CanvasRenderer from './CanvasRenderer';

interface GameCanvasProps {
  lives: number;
  setLives: (lives: number) => void;
}

export default function GameCanvas({ lives, setLives }: GameCanvasProps) {
  const game = useGameLogic(lives, setLives);
  return <CanvasRenderer {...game} />;
}
